import React from 'react';
import styled from 'styled-components';
import banner from '../images/productsbg.jpg';

const Products = () => {
	return (
		<ProductsWrapper>
			<div className='banner'>
				<img src={banner} alt='' />
			</div>
			<div className='products-title'>
				<h3> Products</h3>
				<span className='ball1'></span>
				<span className='ball2'></span>
				<span className='ball3'></span>
				<span className='ball4'></span>
				<span className='ball5'></span>
				<span className='ball6'></span>
				<span className='ball7'></span>
			</div>
		</ProductsWrapper>
	);
};

export default Products;

const ProductsWrapper = styled.section`
	position: relative;
	top: 70px;
	.banner {
		width: 100%;
		height: 250px;
	}
	.banner img {
		width: 100%;
		height: 100%;
	}
	.products-title {
		width: 100%;
		font-family: 'Poppins';
		margin: 2rem auto;
		text-align: center;
	}
	span:nth-child(2) {
		width: 20px;
		height: 20px;
		background: cornflowerblue;
	}
`;
